import {
  createBrowserRouter,
  RouterProvider,
  Route,
} from "react-router-dom";

const router = createBrowserRouter([
  {
    path:"/",
    element: <span>Home</span>
  },
  {
    path:"/products/",
    element: <span>Category</span>
  },
  {
    path:"/product/",
    element: <span>Product</span>
  },
])

function App() {
  return (
    <div>
      <RouterProvider router ={router} />
    </div>
  );
}

export default App;
